import axios from 'axios';

function FetchOpenWeather(cityName) {
    const apiKey = 'b6907d289e10d714a6e88b30761fae22';
    const userCity = 'Москва'

    axios.get(`http://openweathermap.org/data/2.5/weather?q=${cityName}&appid=${apiKey}`)
      .then(response => {
        console.log(response.data)
      })
}

export default FetchOpenWeather;
